editor-css:
/*
  Edit this CSS file to change styles of the editor.
  If you need to revert it back, use the "Reset" button.
*/

/**
* Text Cell
*/

.text-cell {
  font-size: 15px;
  letter-spacing: 1px;
  line-height: 1.6;
  font-family: "Geomanist", "SF Pro Display", "Open Sans";
}

.text-cell h1 {
  font-size: 35px;
  font-weight: 500;
  letter-spacing: .5px;
  font-variant: small-caps;
  margin-top: 5px;
  margin-bottom: 15px;
  margin-left: -8px;
  font-family: "Overlock";
}

.text-cell h2 {
  font-size: 25px;
  font-weight: 400;
  letter-spacing: .5px;
  margin-top: 5px;
  margin-bottom: 10px;
  font-family: "Overlock";
}

.text-cell h3 {
  font-size: 20px;
  font-weight: 400;
  letter-spacing: .5px;
  font-variant: small-caps;
  margin-top: 5px;
  margin-bottom: 10px;
  font-family: "Overlock";
}

.text-cell code {
  color: #FEC356;
  background-color: #636363;
  border: 1px solid #7F7F7F;
  padding: 2px 3px;
  font-family: "Monaco";
}

.text-cell ul {
  list-style: none;
  margin-top: 0px;
  margin-bottom: -5px;
  margin-left: -10px;
}
.text-cell ul li::before {
  content: "â€¢";  /* Add content: \2022 is the CSS Code/unicode for a bullet */
  color: #7F7F7F;
  font-weight: 900;
  display: inline-block;
    /* Needed to add space between the bullet and the text */
  width: 1.2em;
    /* Also needed for space (tweak if needed) */
  margin-left: -20px;
    /* Also needed for space (tweak if needed) */
}

.text-cell ol {
  list-style: none;
  display: table;
  margin-top: 0px;
  margin-bottom: -5px;
  margin-left: -39px;
}

.text-cell li {
  counter-increment: li;  /* need to give line #'s */
  list-style: none;
  display: table-row;

}

.text-cell ol > li::before {
    display: table-cell;
    text-align: right;
    text-indent: 1.1em;
}

.text-cell ol li::before {
  content: counter(li);
  font-family: "Monaco";
  color: #7F7F7F;
  font-size: 75%;
  vertical-align: 5%;
  display: table-cell;
    /* Needed to add space between the number and the text */
  width: 2.1em;
    /* Also needed for space (tweak if needed) */
  text-align: right;
  direction: rtl;
}

.text-cell input {
  vertical-align: 20%;
}

.text-cell a {
  color: #9B76CE;
}

.text-cell img {
  border-radius: 5px;
}


/**
* Code Cell
*/

.code-cell .editor {
  font-size: 13px;
  border-radius: 5px;
}

/**
* LaTeX Cell
*/

.latex-cell .editor {
  font-size: 13px;
}



/**
* Markdown Cell
*/

.markdown-cell .ace_editor {
  background-color: #FFFFFF;
  color: #333;
  font-size: 12px;
  line-height: 1.5;
}

/* # Heading 1 */
.markdown-cell .ace_heading.ace_1, .markdown-cell .ace_heading.ace_1 ~ .ace_heading {
  color: #009BC7;
}

/* ## Heading 2 */
.markdown-cell .ace_heading.ace_2, .markdown-cell .ace_heading.ace_2 ~ .ace_heading {
  color: #009BC7;
}

/* ### Heading 3 */
.markdown-cell .ace_heading.ace_3, .markdown-cell .ace_heading.ace_3 ~ .ace_heading {
  color: #009BC7;
}

/* #### Heading 4 */
.markdown-cell .ace_heading.ace_4, .markdown-cell .ace_heading.ace_4 ~ .ace_heading {
  color: #009BC7;
}

/* ##### Heading 5 */
.markdown-cell .ace_heading.ace_5, .markdown-cell .ace_heading.ace_5 ~ .ace_heading {
  color: #830000;
}

/* ###### Heading 6 */
.markdown-cell .ace_heading.ace_6, .markdown-cell .ace_heading.ace_6 ~ .ace_heading {
  color: #009BC7;
}

/* `code` */
.markdown-cell .ace_support.ace_function {
  color: #830000;
}

/* ordered list, unordered list */
.markdown-cell .ace_list {
  color: #6C6C6C;
}

/* blockquote */
.markdown-cell .ace_blockquote {
  color: #A1B1C1;
}

/* _emphasis_ */
.markdown-cell .ace_emphasis {
  color: #6C6C6C;
  font-style: italic;
}

/* **strong** */
.markdown-cell .ace_strong {
  color: #000;
}

